import React, { Fragment } from 'react';
import { Row, Col, Upload, Button } from 'antd';
import { UploadOutlined } from '@ant-design/icons';
import './styles.css';

export default function BasicSetting() {
    return (
        <Row gutter={[16]}>
            <Col>
                <Fragment>
                    <div className='avatar_title'>
                        Avatar
                    </div>
                    <div className='avatar-setting'>
                        <img src='https://avatars1.githubusercontent.com/u/8186664?s=460&v=4' alt="avatar" />
                    </div>
                    <Upload showUploadList={false}>
                        <div className='button_view-setting'>
                            <Button>
                                <UploadOutlined />
                                Change avatar
                            </Button>
                        </div>
                    </Upload>
                </Fragment>
            </Col>
            <Col></Col>
        </Row>
    );
}
